import ReactDOM from 'react-dom'
import React from 'react'
import Clock from './Clock.js'

function App() {
    return (
        <div>
        <Clock />
        <Clock />
        <Clock />      
    </div>
    )
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
)
